import Home from './components/Home'

import {
  BrowserRouter as Router,
  Routes, Route, Link
} from "react-router-dom"

const App = ({ workshops }) => {

  const padding = {
    padding: 5
  }

  return (
    <Router>
      <div>
        <Link style={padding} to="/">home</Link>
      </div>

      <Routes>
        <Route path="/" element={<Home workshops={workshops} />} />
      </Routes>

      <div>
        <i>Note app, Department of Computer Science 2022</i>
      </div>
    </Router>
  )
}

export default App
